import React from 'react'
import './App.css';

function App() {
  return (
    <div className="App">
      <div className='Main'>
        <div className='Sidebar_Area'>
          Sidebar_Area
        </div>

        <div className='Main_Area'>
          Main_Area
        </div>

        <div className='Left_Sidebar_Area'>
          Left_Sidebar_Area
        </div>
      </div>
    </div>
  );
}

export default App;
